Systems can persist values over multiple executions, known as "local states": #[system]
fn hello_world( #[dynec(local(initial = 0))] counter: &mut i32,
) { *counter += 1; println!("counter = {counter}");
} 0 is the initial value of counter before the system is run the first time. The parameter type must be a reference (&T or &mut T) to the actual stored type. Calling world.execute() in a row will print the following: counter = 1
counter = 2
counter = 3
...

