States can be shared between multiple systems, identified by their type. Such types must implement the Global trait, which can be done through the #[global] macro: #[dynec::global(initial = Self::default())]
#[derive(Default)]
struct MyCounter { value: i32,
} #[system]
fn hello_world( #[dynec(global)] counter: &mut MyCounter,
) { counter.value += 1;
} The initial value of a global state can also be assigned in Bundle::register instead if it is not specified in the #[dynec::global]: impl world::Bundle for Bundle { fn register(&mut self, builder: &mut world::Builder) { builder.schedule(Box::new(hello_world.build())); builder.global(MyCounter { value: 123 }); }
} The program panics if Bundle::register does not initialize all global states. Note that &T and &mut T are semantically different for global states. Multiple systems requesting &T for the same T may run in parallel in a multi-threaded runtime, but when a system requesting &mut T is running, all other &T and &mut T-requesting systems are unschedulable (but other unrelated systems can still be scheduled).

