Simple components can be equipped with an auto-initializer. When an entity is created without passing this component, it is filled with the value returned by the auto-initializer. The auto-initializer can depend on other simple components passed by the entity creator or other auto-initializers. Along with the fact that only components requested from systems get persisted, this means you can pass a parameter during entity creation, let other component auto-initializers read from this parameter, and this parameter will get dropped after entity creation completes. The auto-initializer can be specified in the macro either as a closure: use dynec::comp; #[comp(of = Bullet, init = |velocity: &Velocity| Damage(velocity.norm()))]
struct Damage(f32); or as a function pointer with arity (i.e. number of parameters for the function): use dynec::comp; fn default_damage(velocity: &Velocity) -> Damage { Damage(velocity.norm()) } #[comp(of = Bullet, init = default_damage/1)]
struct Damage(f32);
